import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import SinhvienList from './components/SinhvienList';
import SinhvienForm from './components/SinhvienForm';
import SinhvienDetail from './components/SinhvienDetail';
import './styles.css';

function App() {
  return (
    <Router>
      <div className="app">
        <nav>
          <Link to="/">Danh sách sinh viên</Link> |{' '}
          <Link to="/add">Thêm sinh viên</Link>
        </nav>
        <Routes>
          <Route path="/" element={<SinhvienList />} />
          <Route path="/add" element={<SinhvienForm />} />
          <Route path="/edit/:id" element={<SinhvienForm />} />
          <Route path="/detail/:id" element={<SinhvienDetail />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
